sf.user_info = {id:"",username:""};

body.script:
  var _paq = _paq || [];
  /* tracker methods like "setCustomDimension" should be called before "trackPageView" */
  _paq.push(["setCookieDomain", "*.starfuckers.org"]);
  // you can set up to 5 custom variables for each visitor
  $("a").on("click", function(){ _paq.push(["setCustomVariable", 1, "Action", "Click", "visit"]); });   
if(sf.user_info.username == "")
{
 _paq.push(["setCustomVariable", 2, "UID", 0, "visit"]);
 _paq.push(["setCustomVariable", 3, "Username", "Guest", "visit"]);
}
else
{
_paq.push(["setCustomVariable", 2, "UID", sf.user_info.id, "visit"]);
_paq.push(["setCustomVariable", 3, "Username", sf.user_info.username, "visit"]);
}
_paq.push(["setDoNotTrack", true]);
  _paq.push(['trackPageView']);
  _paq.push(['enableLinkTracking']);
  (function() {
    var u="//analytics.cgnetwork.uk/";
    _paq.push(['setTrackerUrl', u+'piwik.php']);
    _paq.push(['setSiteId', '3']);
    var d=document, g=d.createElement('script'), s=d.getElementsByTagName('script')[0];
    g.type='text/javascript'; g.async=true; g.defer=true; g.src=u+'piwik.js'; s.parentNode.insertBefore(g,s);
